import { createRoot } from 'react-dom/client'
import React, { useState} from 'react';
import {puppyData} from './puppyData';
//import {getPuppies} from './api/api';






const Main = () => { 

    return ( 
        <div class="single-player-card">
        <div class="header-info">
          <p class="pup-title">{puppyData[0].name}</p>
          <p class="pup-number">#{puppyData[0].id}</p>
        </div>
        <img src={puppyData[0].imageUrl} />
        <button class="detail-button" data-id={puppyData[0].id}>See details</button>
      </div>);
    }




const appElement = document.getElementById("app")
